<?php
    include_once 'connection.php';
    session_start();
    $isLoggedIn = isset($_SESSION['loggedin']) && $_SESSION['loggedin'] === true;

    $sql = "
    SELECT L.ID_livro, L.Nome_Livro, L.Link_Imagem, COUNT(LL.ID_lista) AS NumListas
    FROM TabLivro AS L
    JOIN TabLivros_Lista AS LL ON L.ID_livro = LL.ID_livro
    GROUP BY L.ID_livro
    ORDER BY NumListas DESC
    LIMIT 6
    ";
    $result = $connection->query($sql);

    $livros = [];

    if ($result && $result->num_rows > 0) {
        while ($row = $result->fetch_assoc()) {
            $livros[] = $row;
        }
    } else {
        echo "0 results";
    }
    $connection->close();
?>

